import './App.css'
function App() {

  //return starts here
  return (
    <div className="App">
      <div id="drum-machine">
        <div id="display"></div>
        <div className="drum-pads">
        {drumPads.map((drumPad)=>(
        <div 
          onClick={()=>{
          playSound(drumPad.text)
          }} 
          className="drum-pad" 
          id={drumPad.Src}
          >
          {drumPad.text}

          <audio className='clip'
           id={drumPad.text} 
          src={drumPad.Src}
          ></audio>
        </div>
        ))}</div>
      </div>
    </div>
  );
}

export default App;
